import { UsergroupAddOutlined } from '@ant-design/icons'
import { useSuiClient, useSuiClientInfiniteQuery, useSuiClientQuery } from '@mysten/dapp-kit'
import { Badge, Button, Card, Carousel, Divider, Image } from 'antd'
import { SUI_HAI_SERVER } from '/@/utils/constants'
import { useEffect, useState } from 'react'
import { useNetworkVariable } from '/@/utils/networkConfig'
const { Meta } = Card

// 服务器数据类型
interface ServerData {
  activity_fee: string
  activity_max_join_fee: string
  id: {
    id: string
  }
  members: {
    type: string
    fields: {
      id: {
        id: string
      }
      size: string
    }
  }
  name: string
  pool_balance: string
}

interface ActivityData {
  creator: string;
  date_range: string[];
  description: string;
  location: string;
  tag: string;
  title: string;
}

function HomePage () {
  const packageId = useNetworkVariable('packageId')
  const client = useSuiClient()
  const [serverData, setServerData] = useState<ServerData>()
  const [activityData, setActivityData] = useState<ActivityData[]>([])
  const {
    data: registerEvents,
  } = useSuiClientInfiniteQuery(
    "queryEvents",
    {
      query: {
        MoveModule: {
          package: packageId,
          module: "sui_hai",
        },
      },
      order: "descending",
    },
    {
      refetchInterval: 10000,
    }
  )

  const {
    data: activityEvents,
  } = useSuiClientQuery(
    'queryEvents',
    {
      query: {
        // MoveModule: {
        //   package: packageId,
        //   module: "activity",
        // },
        MoveEventType:  `${packageId}::activity::CreateActivityEvent`,
      },
      order: "descending",
    },
    {
      refetchInterval: 10000,
    }
  )

  useEffect(() => {
    console.log(activityEvents)
    if (activityEvents && activityEvents.data) {
      const formatArr = activityEvents.data.map(item => item.parsedJson) as unknown as ActivityData[]
      setActivityData(formatArr)

    }
  }, [activityEvents])

  useEffect(() => {
    console.log(registerEvents)
    if (registerEvents && registerEvents.pages.length > 0 && registerEvents.pages[0].data.length > 0) {
      getServerData()
    }
  }, [registerEvents])

  useEffect(() => {
    getServerData()
  }, [])

  const getServerData = async () => {
    const { data: sdata, error } = await client.getObject({
      id: SUI_HAI_SERVER,
      options: {
        showContent: true
      }
    })
    if (error) {
      console.error(error)
    } else {
      if (sdata && sdata.content?.dataType === 'moveObject') {
        setServerData(sdata.content.fields as unknown as ServerData)
      }
    }
  }
  return (
    <div className="flex flex-col">
      <div className="flex justify-between items-center">
        <div className="flex items-center">
          <div>总用户数：{serverData?.members.fields.size} 人</div>
        </div>
      </div>
      <Divider />
      <div className="grid grid-cols-5 gap-5">
        {
          activityData.map((item, index) => (
            <Badge.Ribbon key={index} text={item.tag}>
              <Card
                hoverable
                cover={
                  <Carousel arrows infinite={false}>
                    <div>
                      <Image
                        className="object-cover"
                        width={'100%'}
                        height={200}
                        src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
                        fallback="data:image/png;base64,"
                      />
                    </div>
                    <div>
                      <Image
                        className="object-cover"
                        width={'100%'}
                        height={200}
                        src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
                        fallback="data:image/png;base64,"
                      />
                    </div>
                    <div>
                      <Image
                        className="object-cover"
                        width={'100%'}
                        height={200}
                        src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
                        fallback="data:image/png;base64,"
                      />
                    </div>
                    <div>
                      <Image
                        className="object-cover"
                        width={'100%'}
                        height={200}
                        src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
                        fallback="data:image/png;base64,"
                      />
                    </div>
                  </Carousel>
                }
                actions={[
                  <Button type="text"><UsergroupAddOutlined />立即参加</Button>
                ]}
              >
                <Meta title={item.title} description={item.description} />
              </Card>
            </Badge.Ribbon>
          ))
        }
        <Card
          hoverable
          cover={
            <Carousel arrows infinite={false}>
              <div>
                <Image
                  className="object-cover"
                  width={'100%'}
                  height={200}
                  src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
                  fallback="data:image/png;base64,"
                />
              </div>
              <div>
                <Image
                  className="object-cover"
                  width={'100%'}
                  height={200}
                  src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
                  fallback="data:image/png;base64,"
                />
              </div>
              <div>
                <Image
                  className="object-cover"
                  width={'100%'}
                  height={200}
                  src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
                  fallback="data:image/png;base64,"
                />
              </div>
              <div>
                <Image
                  className="object-cover"
                  width={'100%'}
                  height={200}
                  src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
                  fallback="data:image/png;base64,"
                />
              </div>
            </Carousel>
          }
          actions={[
            <Button type="text"><UsergroupAddOutlined />立即参加</Button>
          ]}
        >
          <Meta title="测试测试" description="描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述描述" />
        </Card>
      </div>
    </div>
  )
}

export default HomePage
